const { Component, createRef } = React;
class Noti extends Component {
  constructor(props) {
    super(props);
    this.checkboxRef = createRef();
  }
  componentDidMount() {
    if(this.checkboxRef.current) {
      this.checkboxRef.current.indeterminate = this.props.indeterminate;
    }
  }
  render() {
    return (
      <input
        type="checkbox"
        ref={this.checkboxRef}
      />
    );
  }
}
export default Noti
